import { Component } from "react";
import React from "react";
import Portfolio from "../components/portfolio";

//import image
import image1 from "../img/image1.jpg";
import image2 from "../img/image2.jpg";
import image3 from "../img/image3.jpg";
import image4 from "../img/image4.jpg";
import image5 from "../img/image5.jpg";
import image6 from "../img/image6.jpg";

class PortfolioContainer extends Component {
    render(){
        return(
            <section id="work" className="portfolio-mf sect-pt4 route">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-12">
                        <div className="title-box text-center">
                            <h3 className="title-a">Portfolio</h3>
                            <p className="subtitle-a">
                            I have completed several projects. If you are interested, let's learn about my project
                            </p>
                            <div className="line-mf"></div>
                        </div>
                        </div>
                    </div>
                    <div className="row">
                        <Portfolio title="Siap OPA JABAR" desc="Mobile Apps Using Android Studio" image="image1"/>
                        <Portfolio title="Iteung" desc="WhatsApp Bot"/>
                        <Portfolio title="Ateng" desc="Mobile Apps Using React Native"/>
                        <Portfolio title="TTS Bot" desc="Mobile Apps Using Kotlin"/>
                        <Portfolio/>
                        <Portfolio/>
                    </div>
                </div>
            </section>
        )
    }
}

export default PortfolioContainer;
